import React from "react";
import './styles/about.css';

const AboutMe = () => {
	return (
		<div className="about_me_container">
			<div className="about_me_title_container">
				<span className="about_me_title"><strong>/about</strong></span>
			</div>

			<div className="about_me_info">
			I'm a Developer and a hold a {' '}
			<a class="link-parchment" target="_blank" rel="noopener noreferrer" 
				href="https://www.parchment.com/u/award/cdc63a097762a059103a9b3ce857a15e">
				Bachelors of Science in Computer Science
			</a> {' '}from the{' '} 
			<a class="link-gatech" target="_blank" rel="noopener noreferrer" href="https://www.cc.gatech.edu/">
              <strong class="georgia-tech">College of Computing</strong>
            </a> '}
			at Georgia Tech. with a passion for software, complexity, and design. At Georgia Tech, I concentrated in Information Networks,
			and Media Applications, and built a strong foundation in topics such as Data Structures and Algorithms,
			Database Systems and Networks, and Mathematics.
			</div>
		</div>
	);
}

export default AboutMe;
